INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 2, 1, 40, 20063115, 2834, 10118, 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, "青空の下で謁見", "ペコリーヌとの出会い", 5118061, "フリーマーケット会場", 7);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 2, 1, 40, 20063115, 2835, 10118, 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, "未来の騎空団\nマスコット？", "マホとの出会い", 5118062, "フリーマーケット会場", 7);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 2, 1, 40, 20063115, 2837, 10118, 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, "お嬢さまからの\n緊急依頼", "アキノとの出会い", 5118063, "ランドソル市街地", 7);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 2, 1, 40, 20063115, 4108402, 10118, 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, "黄金色の悩みごと", "ジュンとの出会い", 5118064, "フリーマーケット会場", 18);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 2, 1, 40, 20063115, 4107402, 10118, 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, "白熱！　格闘大会！", "カオリとの出会い", 5118065, "フリーマーケット会場", 18);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 2, 1, 40, 20063115, 9000227, 10118, 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, "祭り太鼓はオーエドの華", "ニノンとの出会い", 5118066, "オーエド町", 16);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 3, 1, 40, 20063115, 2101181, 10118, 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, "人気者は遅れて\nやってくる", "スズナとの出会い", 5118067, "フリーマーケット会場", 19);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 3, 1, 40, 20063115, 4109402, 10118, 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, "巫女・ミーツ・魔法少女", "ナナカとの出会い", 5118068, "ランドソル市街地", 18);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 3, 1, 40, 20063115, 4305402, 10118, 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, "ネズ耳は二度なくなる", "キャル＆コッコロとの出会い", 5118069, "フリーマーケット会場", 18);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 3, 1, 40, 20063115, 4101402, 10118, 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, "この出会いにカンパイ！", "ユカリとの出会い", 5118070, "ランドソル市街地", 18);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 3, 1, 40, 20063115, 4106402, 10118, 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, "陰陽アンサンブル", "アオイとの出会い", 5118071, "ランドソル市街地", 18);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (8, 3, 1, 40, 20063115, 2836, 10118, 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, "運試し十番勝負！", "シノブとの出会い", 5118072, "フリーマーケット会場", 7);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES (0, 1, 0, 0, 20063115, 0, 10118, 0, 0, 0, "彼女たちの新たな日常", "オープニング", 5118600, 0, 0);
